import React, {Component} from 'react';
import PropTypes from 'prop-types';

let bg = 'data:image/png;base64,';
let bgx2 = 'data:image/png;base64,';
let bgx3 = 'data:image/png;base64,';
let logo = 'data:image/png;base64,';
let logox2 = 'data:image/png;base64,';
let logox3 = 'data:image/png;base64,';
let base = 'data:image/png;base64,';
let basex2 = 'data:image/png;base64,';
let basex3 = 'data:image/png;base64,';

class Loading extends Component {
    static propTypes = {
        theme: PropTypes.string,
        model: PropTypes.string
    };

    render() {
        let theme = this.props.theme || 'logo';
        let model = this.props.model || 'default';
        let classModel = 'mcds-loading__' + model;
        let bgSrc = '';
        let parrotSrc = '';
        if (theme === 'logo'){
            switch (model) {
            case 'tiny':
                bgSrc = bg;
                parrotSrc = logo;
                break;
            case 'small':
                bgSrc = bgx2;
                parrotSrc = logox2;
                break;
            case 'default':
                bgSrc = bgx2;
                parrotSrc = logox2;
                break;
            case 'large':
                bgSrc = bgx3;
                parrotSrc = logox3;
                break;
            default :
                console.warn('no placement please check props.model');
            }
        } else if (theme === 'base') {
            switch (model) {
            case 'tiny':
                bgSrc = base;
                break;
            case 'small':
                bgSrc = basex2;
                break;
            case 'default':
                bgSrc = basex2;
                break;
            case 'large':
                bgSrc = basex3;
                break;
            default :
                console.warn('no placement please check props.model');
            }
        }
        return (
            <div className={classModel}>
                <div className="mcds-loading__box">
                    <img className="bg" src={bgSrc} />
                </div>
                {
                    theme === 'logo' ? <img className="mcds-loading__parrot" src={parrotSrc} /> : null
                }
            </div>
        );
    }
}

export default {
    Loading
};
